script: |
  super -f text -I q10498.spq | sort > q10498.out

inputs:
  - name: q10498.spq
    data: |
      SELECT DISTINCT - ( col0 ) FROM tab2 (FORMAT parquet) WHERE - 51 NOT BETWEEN + col2 / - col1 AND + col1 * col2;
  - name: tab2

outputs:
  - name: q10498.out
    data: |
      -46
      -64
      -75
